import './App.css';
import './assets/Home';

import MainPage from "../src/components/MainPage/MainPage"
import VLibras from 'vlibras-react';
import Vlibras from './components/Vlibras/Vlibras.json'


function App() {
  return (
    <>
    <VLibras  personalization="https://vlibras.gov.br/config/default_logo.json." opacity={0.5} rootPath={Vlibras} />
    <MainPage />
    </>
  );
}
export default App;
